import React, { Component } from 'react';
import ReactTable from "react-table";
import "react-table/react-table.css";
//import OrderData from './OrderData.json';

class DataTable extends Component {
  constructor(){
    super();
    this.state={

      OrderData:[],
      columns:[{
        Header: 'Date:',
        accessor: 'date'
      },{
        Header: 'Created By:',
        accessor: 'createdBy'
      },{
        Header: 'Account Number:',
        accessor: 'accountNum'
      },{
        Header: 'PO Number:',
        accessor: 'PO'
      },{
        Header: 'Order Number:',
        accessor: 'orderNum'
      },{
        Header: 'Order Status:',
        accessor: 'orderStatus'
      },
      {
        Header: 'Total:',
        accessor: 'total'
      },
    ],
    }
  }
    componentDidMount() {
      fetch('10.202.170.107/DashboardAPI/OrderTracking')
          .then((response) => response.json())
          .then((responseJson) => {
              console.log(responseJson);
          })
    }


  render() {
    return (
          <div>
              <ReactTable 
                data={this.state.OrderData}
                columns={this.state.columns}
                defaultPageSize = {10}
                style={{
                  height: "300px" 
                }}

              />

          </div>
    )

  }
}


export default DataTable;
